import React from 'react';
import ReactDom from 'react-dom';
import './index.css'
import Card from './Card'
import Mobiles from './List'

/*console.log(Mobiles[0].title)*/
ReactDom.render(
<div className=''>
<h1>Hello.. Gud morning</h1>
<Card 
imgsrc={Mobiles[0].imgsrc}
title={Mobiles[0].title}
/>
<Card 
imgsrc={Mobiles[1].imgsrc}
title={Mobiles[1].title}
/>
<Card 
imgsrc={Mobiles[1].imgsrc}
title={Mobiles[1].title}
/>
<Card 
imgsrc={Mobiles[1].imgsrc}
title={Mobiles[1].title}
/>
</div>,
document.getElementById('root')
);
